SET linesize 350
SET pagesize 60

CLEAR screen;

DROP table publikacje;

create table publikacje (
    ID NUMBER(6,0) PRIMARY KEY,
    Rok NUMBER(4,0),
    Autorzy NUMBER(2,0),
    Punkty NUMBER(3,0),
    Tytul VARCHAR2(195)
);





select * from publikacje where ROK = 2020 and PUNKTY/Autorzy >= 100 order by AUTORZY; 